export enum SetOfArtObjects {
    ball = 'data:image/svg+xml;base64,',
    BLM = "data:image/svg+xml;base64,",
    police = "data:image/svg+xml;base64,",
    frog = "data:image/svg+xml;base64,",
}
  
export type CardMaker = {
    canvas: Canvas,
    patterns: Canvas[],
    selectedObject: number,
    stateHistory: StateHistory
}
  
export type Canvas = {
    readonly displayList: number[],
    readonly elementList: ElementList[],
    readonly height: number,
    readonly width: number,
    readonly area: Area | null,
    readonly filter: Filter,
    readonly background: Background,
}
  
export type ElementList = Image | TextComponent | ArtObject
  
export type Component = {
    readonly height: number,
    readonly width: number,
    readonly x: number,
    readonly y: number,
    readonly id: number,
}
  
export type Image = {
    readonly type: 'img',
    readonly src: string,
} & Component
  
export type Background = {
    readonly color: string | null,
    readonly src: string | null,
}  
export type ArtObject = {
    readonly type: 'artObj',
    readonly src: string
} & Component
  
export type TextComponent = {
    readonly type: 'text',
    readonly data: string, 
    readonly bold: boolean,
    readonly italic: boolean,
    readonly underline: boolean,
    readonly fontSize: number,
    readonly font: string,
    readonly color: string,
} & Component
  
export type Area = {
    readonly width: number,
    readonly firstPoint: number,
    readonly secondPoint: number,
}
  
export type StateHistory = {
    readonly listState: Canvas[],
    readonly currentIndex: number,
}
  
export type Filter = {
    readonly color: string,
    readonly transparency: number,
}
